maps.description:
the very special thing about this version of bedouins is, that every oasis is spawned manually with create_land and landposition. It&#x27;s only possible to spawn up to 99 lands, the maximum of spawned oasis is 81 for Huge and Gigantic size.
The forest around the oasis are created by the new command from DE &quot;actor_area&quot;
the vill randomness of the spawns was reduced as well a little bit (from 70 to 40)

